import cardimg1 from "./asset/respiratory rate.png";
const carddet = [
    {
      id:1,
      iconname:cardimg1,
      name:'Respiratory Rate',
      value:'20 bpm',
      subname:'Normal',
    },
    {
        id:2,
        iconname:cardimg2,
        name:'Temperature',
        value:'98.6 F bpm',
        subname:'Normal',
      },
      {
        id:3,
        iconname:cardimg3,
        name:'Heart Rate',
        value:'78 bpm',
        subname:'Lower than Average',
      }
      
]
export default carddet;
